import Transfer from "../Pages/Transfer";
import { Button, Flex, Box } from 'rebass'

import { Card } from "reactstrap";
class User extends Component 
{
  constructor()
  {
    super();
    this.state={ 
      firstName:"",
      lastName:"",
      fetchedData:[],
      CheckingsPage: false,
      SavingsPage: false,
      PersonalCheckingsPage: false,
      DBAPage: false,
      CDPage: false,
      IRAPage: false,
      RothIRAPage: false,
      TransferPage: false
    }
    this.hideComponent = this.hideComponent.bind(this);
  }
